import { useSelector } from 'react-redux';
import './App.scss'
import Sidebar from './components/Sidebar/Sidebar';
import Cats from './components/Cats/Cats';
import Spinner from './components/Spinner/Spinner';
import {
  BrowserRouter as Router, Switch, Route,
} from 'react-router-dom';

function App() {
  const { categoriesStatus } = useSelector(state => state.categories);

  return (
    <Router>
       <Switch>
          <div className="App">
            {categoriesStatus === 'pending' &&  <Spinner />}
            <div className="app-wrapper">
              <Sidebar />
              {/* {Routes.map((route) => {
                <Route key={route.name} path={route.path} component={<Cats /> } exact={route.isExact} />
              })} */}
              <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/acc" element={<Acc />} />
              <Route path="/shop" element={<Shop />} />
              <Route path="/inspiration" element={<Inspiration />} />
              <Route path="/contactus" element={<ContactUs />} />
              <Route path="/policyprivacy" element={<PrivacyPolicy />} />
              <Route path="/termsconditions" element={<TermsConditions />} />
            </Routes>
            </div>
          </div>
       </Switch>
    </Router>
  );
}

export default App;
